import React, { PureComponent } from 'react';

const ICON = 'medias/icone-easylunch-orange.png';

const pinStyle = {
  fill: '#d00',
  stroke: 'none',
};

export default class RestoPin extends PureComponent {
  render() {
    const { size = 20, onClick } = this.props;

    return (
      <svg
        height={size}
        viewBox="0 0 24 24"
        style={{ ...pinStyle, transform: `translate(${-size / 2}px,${-size}px)` }}
        onClick={onClick}
      >
        <img src={ICON} alt="icone" />
      </svg>
    );
  }
}
